CREATE DEFINER=`root`@`%` PROCEDURE `Dashboard_Views` (IN `Role` INT(11), IN `UserId` INT(11), OUT `Total_Employees` INT(11), OUT `Active_Employees` INT(11), OUT `Inactive_Employees` INT(11), OUT `ToatalPending_LeaveRequests` INT(11), OUT `Selected_Employees` INT(11), OUT `Rejected_Employees` INT(11), OUT `Shortlisted_Emp` INT(11), OUT `MyPending_Leaves` INT(11), OUT `ManagerPending_Leaves` INT(11), OUT `Screening_Types` INT(11), OUT `Ethnic_Codes` INT(11), OUT `Birthday` VARCHAR(100))  BEGIN
SELECT count(*) as Total_employees INTO @emp_count FROM main_employees;
SELECT count(*) as Active_employees INTO @emp_active FROM main_employees WHERE isactive='1';
SELECT count(*) as Inactive_employees INTO @emp_inactive FROM main_employees WHERE isactive='0';

SELECT count(*) as TotalPending_leaverequests INTO @requests FROM main_leaverequest WHERE leavestatus='Pending for approval';

SELECT count(*) as Selected_employees INTO @slctd_emp FROM main_candidatedetails WHERE cand_status='Selected';
SELECT count(*) as Rejected_employees INTO @rejected_emp FROM main_candidatedetails WHERE cand_status='Rejected';

SELECT count(*) as Shortlisted_emp INTO @shortlisted_emp FROM main_candidatedetails WHERE cand_status='Shortlisted' ;

SELECT count(*) as MyPending_leaves INTO @user_pendingLeaves FROM main_leaverequest WHERE leavestatus='Pending for approval' AND user_id=UserId ;

SELECT count(*) as ManagerPending_leaves INTO @manager_pendingLeaves FROM main_leaverequest WHERE leavestatus='Pending for approval' AND rep_mang_id=UserId ;

SELECT count(*) as Screening_types INTO @screening_type FROM main_bgchecktype;
SELECT count(*) as Ethnic_codes INTO @ethnic_code FROM main_ethniccode;

SET @crntdate= DAY(NOW());
SET @crntmnth= MONTH(NOW());
SET @cnct=concat('%',CONCAT_WS('-',@crntmnth,@crntdate));

 SELECT GROUP_CONCAT(u.userfullname) INTO @username FROM main_users as u LEFT JOIN main_emppersonaldetails as p on u.id=p.user_id WHERE p.dob LIKE  @cnct;
 SET  Birthday =@username;
SET Total_Employees= @emp_count;
SET Active_Employees = @emp_active;
SET Inactive_Employees = @emp_inactive;
SET ToatalPending_LeaveRequests = @requests;
SET Selected_Employees = @slctd_emp;
SET Rejected_Employees = @rejected_emp;
SET Shortlisted_Emp = @shortlisted_emp;
SET MyPending_Leaves = @user_pendingLeaves;
SET ManagerPending_Leaves = @manager_pendingLeaves;
SET Screening_Types= @screening_type;
SET Ethnic_Codes = @ethnic_code;

if Role ='1' then
SELECT Birthday,Total_Employees, Active_Employees, Inactive_Employees, ToatalPending_LeaveRequests, Selected_Employees, Rejected_Employees,Ethnic_Codes;
end if;

if Role ='2' then
SELECT Birthday,Total_Employees,Active_Employees,Inactive_Employees,Selected_Employees,Rejected_Employees;
end if;

if Role ='3' then
SELECT Birthday,Total_Employees,Active_Employees,Inactive_Employees,Selected_Employees;
end if;

if Role ='4'then
SELECT Birthday,Total_Employees,Active_Employees,Inactive_Employees,Selected_Employees,Rejected_Employees,Shortlisted_Emp,Screening_Types;
end if;

if Role = '5' then
SELECT Birthday,Total_Employees,Active_Employees,Inactive_Employees,MyPending_Leaves,ManagerPending_Leaves;
end if;

if Role ='6' then
SELECT Birthday,MyPending_Leaves;
end if;

if Role ='7' then
SELECT Birthday,Total_Employees,Active_Employees,Inactive_Employees,Ethnic_Codes;
end if;


END$$

CREATE DEFINER=`Test_EEAccess_admin`@`%` PROCEDURE `EmpSumary` (IN `EmployeeID` VARCHAR(200), IN `Prefix` INT(11), IN `Firstname` VARCHAR(255), IN `Lastname` VARCHAR(255), IN `Userfullname` VARCHAR(250), IN `Modeofentry` VARCHAR(100), IN `Role` INT(11), IN `Business_id` INT(11), IN `Department_id` INT(11), IN `Reporting_manager` INT(11), IN `Job_title_id` INT(11), IN `Position_id` INT(11), IN `Emp_status_id` INT(11), IN `Date_of_joining` DATE, IN `Date_of_leaving` DATE, IN `Years_exp` VARCHAR(10), IN `Office_number` VARCHAR(20), IN `Extension_number` VARCHAR(20), IN `Office_faxnumber` VARCHAR(20), IN `Email` VARCHAR(100))  BEGIN
