CREATE DEFINER=`root`@`%` PROCEDURE `leaves_corn` ()  BEGIN

DECLARE done INT DEFAULT FALSE;
DECLARE uid INT;

DECLARE cur1 CURSOR FOR SELECT id FROM main_users;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

START TRANSACTION;
SELECT numberofdays INTO @days FROM main_employeeleavetypes WHERE leavetype='Casual Leave' ;
SET @monthlyleaves= @days/12;
SET @crntdate=NOW();
SET @yr=YEAR(@crntdate);
SET @mnth=MONTH(@crntdate);
SET @lstyear=@yr-1;


	IF (@mnth = '01') then
    OPEN cur1;
  read_loop: LOOP
    FETCH cur1 INTO uid;
    
    IF done THEN
      LEAVE read_loop;
    END IF;
    SELECT isactive INTO @isActive FROM main_users WHERE id=uid;
    IF (@isActive = '1') THEN
    SELECT emp_leave_limit,used_casual_leaves INTO @leave_limit, @used_leaves FROM main_employeeleaves WHERE alloted_year=@lstyear AND user_id=uid ;
	SET @balance_leaves= (@leave_limit)- (@used_leaves);
		if(@balance_leaves >= '8') THEN
			SET @balance_leaves = '8';
		End if;
	SET @lvs=(@balance_leaves) + (@monthlyleaves);
	
	if not exists(SELECT createddate FROM main_allottedleaveslog WHERE year=@yr and userid=uid) THEN
	end if;
    END IF;
    END LOOP;

  CLOSE cur1;
  else 
	OPEN cur1;
  read_loop: LOOP
    FETCH cur1 INTO uid;
    
    IF done THEN
      LEAVE read_loop;
    END IF;
    SELECT isactive INTO @isActive FROM main_users WHERE id=uid;
    IF (@isActive = '1') THEN
    SELECT assignedleaves, modifieddate INTO @Lvs, @mdate FROM main_allottedleaveslog WHERE year=@yr AND userid=uid;
		SET @Lvs= (@Lvs) + (@monthlyleaves);
		SET @mdate=MONTH(@mdate);
	if(@mdate != MONTH(CURDATE())) THEN
		UPDATE main_allottedleaveslog  SET assignedleaves=@Lvs,modifieddate =@crntdate WHERE year=@yr AND userid=uid;
		UPDATE main_employeeleaves SET  emp_leave_limit=@Lvs, modifieddate =@crntdate  WHERE alloted_year=@yr AND user_id=uid;
	end if;
   
	SET SQL_SAFE_UPDATES=0;
     END IF;

	END LOOP;

  CLOSE cur1;
   
    
END IF;

 
COMMIT;
END$$

CREATE DEFINER=`root`@`%` PROCEDURE `multiple_leaves` (IN `StringValue` LONGTEXT, IN `leaveStatus` VARCHAR(255), OUT `message` VARCHAR(255))  BEGIN
 DECLARE INDX INT;
 DECLARE SLICE nvarchar(4000); 
 SET INDX = 1;
SET @current_year =year(now());

 MyLoop: WHILE INDX != 0 DO
  SET INDX = LOCATE(',',StringValue);
  IF INDX !=0 THEN
  SET SLICE = LEFT(StringValue,INDX - 1);
 ELSE
  SET SLICE = StringValue;
 END IF;
 IF(leaveStatus = 'Cancel' || leaveStatus = 'Rejected') THEN
SELECT r.user_id,r.no_of_days,t.leavetype INTO @userID,@Days,@LeaveType FROM main_leaverequest as r LEFT JOIN main_employeeleavetypes as t on t.id=r.leavetypeid WHERE r.id = SLICE;
 
 IF @LeaveType = 'Casual Leave' THEN
 select used_casual_leaves INTO @used_leaves  FROM main_employeeleaves WHERE user_id = @userID and alloted_year =@current_year;
 UPDATE main_leaverequest SET leavestatus =leaveStatus where id = SLICE;
 SET @new_days = @used_leaves-@Days;
 UPDATE main_employeeleaves SET used_casual_leaves = @new_days WHERE user_id = @userID and alloted_year = @current_year;
 END IF;
  IF @LeaveType = 'Sick Leave' then
 select used_sick_leaves INTO @used_leaves  FROM main_employeeleaves WHERE user_id = @userID and alloted_year =@current_year;
 UPDATE main_leaverequest SET leavestatus =leaveStatus where id = SLICE;
 SET @new_days = @used_leaves-@Days;
 UPDATE main_employeeleaves SET used_sick_leaves = @new_days WHERE user_id = @userID and alloted_year = @current_year;
 END IF;
ELSE
UPDATE main_leaverequest SET leavestatus =leaveStatus where id = SLICE;
END IF;
  SET StringValue = RIGHT(StringValue,LENGTH(StringValue) - INDX);
  IF LENGTH(StringValue) = 0 THEN
  LEAVE MyLoop;

 END IF;
 END WHILE;
 SET message = "Status Updated Successfully";
SELECT message;

END$$

